      "announcement": "New design released every week! - beanforest\r\n  ---  We are happy to extend wholesale pricing to independent gift shops, bookstores, and educational institutions. Contact us here on Etsy or write to beanforest(a)gmail.com for more info! \r\n\r\nMore art by beanforest can be found at jankybeanforest.blogspot.com.\r\n\r\n-----------    All art and content \u00a9 2009-2014 The Calamity Collective. This is hard work, so please don&#39;t bite our stuff thinkin&#39; it&#39;s no big deal. We&#39;ll bite back. Physically. Aggressively. Mercilessly. Some friggin SCARY raccoons taught us their technique after we bribed them with leftover cheeseburgers. You&#39;ll need to go to the doctor, get shots, the whole bit.",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": "beanforest is out causing mischief on a brief vacation!\r\n\r\nwww.beanforest.etsy.com will reopen on Sunday, June 3rd (at the latest) and purchases will be stamped\/shipped in the order received starting June 9th.\r\nIf you have any questions, don&#39;t hesitate to write and I will reply as fast as possible once the shop is back up on the 3rd.\r\n\r\nAny order already placed will be mailed before I leave, and you will receive a shipment confirmation message soon.\r\n\r\nThanks so much!\r\n\r\nbeanforest\r\n",
      "sale_message": "Thank you so much for your purchase!\r\n\r\nButtons and magnets are stamped to order and will be processed within 5 business days after received payment. They are shipped to the address provided through Etsy unless you specify otherwise.\r\n\r\nYou will receive a message from me confirming your address and shipment as soon as things are stamped and ready.\r\n\r\nSee Shop Policies for details regarding refunds\/exchanges. Orders are sent USPS First Class by default. If you have special shipping needs (insurance, tracking, expedited, etc) please notify me in the message to seller or send a convo. International customers may be responsible for additional customs duties\/tariffs\/taxes that may apply to you order. Every country&#39;s customs policies are different, so please speak with your mail service if you have any questions.\r\n\r\nCustomer satisfaction is extremely important to me. If there is anything about either the merchandise or shopping experience that would keep you from leaving positive feedback, I would love the opportunity to make things right.\r\n\r\nIf you have any other questions regarding your order, my shop, or Etsy in general, write me either here on Etsy or beanforest@gmail.com. Messages sent to beanforest@gmail.com will most likely be replied to on Etsy for the sake of keeping communication collected in one place.\r\n\r\nThanks again!\r\n\r\nVince\r\nbeanforest",
      "digital_sale_message": null,
      "last_updated_tsz": 1410279107,
      "listing_active_count": 582,
      "login_name": "beanforest",
      "accepts_custom_requests": false,
      "policy_welcome": "Beanforest and the Calamity Collective would love to be carried at your favorite gift shop or bookstore! For more information, write us here on Etsy, at calamitycollective(a)gmail.com, or call us at 616.856.6556.",
      "policy_payment": "Payment methods include Paypal, Visa, Mastercard, American Express, and Discover. Credit card purchases can be processed through Paypal (you don&#39;t need a Paypal account for this) or through Etsy&#39;s Direct Checkout feature. If you&#39;re having trouble checking out through Paypal or Etsy Direct Checkout, contact us and we might be able to arrange payment through a postal money order.\r\nNote to customers in Michigan: there will be a 6% sales tax addition to your purchase total.",
      "policy_shipping": "Buttons and magnets are stamped to order and will be processed within 5 business days after received payment. They are shipped to the address provided through Etsy unless you specify otherwise.\r\n\r\nSmall button orders are shipped first class in a bubble-mailer via USPS. Larger orders will be shipped in a bubble mailer or small box. If you have any special shipping needs like insurance, tracking, or upgrades to Priority shipping, please write before checking out and a reserved listing will be created to accommodate you. Buttons are secured together using as little tape as possible to keep them from scuffing during shipment. In rare occasions, this can be tricky to remove and apologies in advance should this happen! The tape is usually very reliable and meant to keep your purchase safe.\r\n\r\nA message confirming your address will be sent either the night before or day of shipment so you know when your order is on the way. Feedback will be left as soon as possible.\r\n\r\nTO ALL INTERNATIONAL CUSTOMERS: additional customs duties\/tariffs\/taxes may apply to your order. Every country is different, so please speak with your mail service if you have any questions.",
      "policy_refunds": "All orders are non-refundable. If you want better pictures or more information regarding the product before you commit to the sale, we will be happy to provide it. All merchandise offered is new and inspected for quality previous to shipping.\r\n\r\nRegarding lost or damaged merchandise:\r\nSmall Button Orders\r\nIf a small button order ($10 or less) arrives damaged, mail the affected merchandise back and it will be replaced free of charge. Please do so within a week of receiving the item and write us in advance so we know what is coming back and when to expect it!\r\nThings occasionally get lost in the mail, and if you still haven\u2019t received your order within 14 business days (30 days for international) of the transaction, this could be the case\u2026 Send a message and we can work something out.\r\n\r\nLarger Orders\r\nLarger orders are carefully packaged to ensure the safety of your merchandise. If a few items are damaged in the process, you can mail them back and they will be replaced free of charge (please write before shipping), but this can&#39;t be done for an entire order; the post office is usually pretty reliable, but if you are concerned about a large order getting lost or damaged, consider adding insurance to the shipment.\r\n\r\nCustomer satisfaction is extremely important to us and we want to make transactions as smooth as possible. If there is anything that may deter you from leaving positive feedback, please let us know before leaving the neutral\/negative feedback and we will do whatever we can to remedy the issue!",
      "policy_additional": "If you have a retail store and are interested in carrying us, we would love to talk to you! You can write us here or at beanforest@gmail.com.\r\n\r\nButtons are 1.25&quot; in diameter and all artwork is produced high res on a color laser printer.\r\n\r\nBoring Copyright\/Intellectual Property rant from Beanforest:\r\nI\u2019m sensitive to the creative process and I take intellectual property rights seriously. As such, if I have any art or ideas here or on my other links that have grabbed your interest, please message me and maybe we can work out usage rights or team up on a project. I\u2019m friendly and reasonable. Seriously, few things bum an artist out more than seeing their ideas straight-up stolen. If I find somebody stealing my stuff, I promise I am no longer friendly and reasonable.\r\nLIKEWISE! If there\u2019s anything in this store or associated links that you feel has been taken from somewhere else, please bring it to my attention! I can assure you it wasn\u2019t intentional, but inspiration is a fickle thing and it\u2019s impossible to track every single memory and influence.",
      "policy_seller_info": null,
      "policy_updated_tsz": 1405041246,
      "vacation_autoreply": "This is an Auto-Reply. I am currently on a brief vacation and will reply to messages in the order they&#39;re received as soon as the shop reopens on June 3rd.\r\n\r\nThanks so much!\r\n\r\nVince\r\nbeanforest\r\n",
