      "vacation_autoreply": "This is an Auto-Reply. I am currently on a brief vacation and will reply to messages in the order they&#39;re received as soon as the shop reopens on June 3rd.\r\n\r\nThanks so much!\r\n\r\nVince\r\nbeanforest\r\n",
