      "title": "One of a Kind Favor Boxes, Party Decorations and More!",
      "announcement": "Unique and whimsical invitations, party decorations and favor boxes for every occasion!\r\n\r\n[OUR MISSION]: To help you create fun and memorable parties on a piggy bank budget! We create unique HAM-made and printable items you won&#39;t find anywhere else. Each design is created in our lil&#39; PiG PeN and designed and illustrated by our resident artists. Every handmade item that leaves our studio is something we would be proud to feature at our own personal celebrations. We also offer DIY printables (digital files you print at home) as an affordable alternative to our handmade items.\r\n\r\nTo keep our prices as low as possible, our printable products do not include color, font or artwork customization. Many of our handmade items include design menus which allow you to create your own unique product without breaking the bank. If you&#39;d like to further customize our products for your event, we are happy to accommodate if we have availability, but please be aware that additional fees will be incurred. We wish we could offer changes for free but these lil&#39; piggies need to eat!\r\n\r\n&gt;&gt;&gt;&gt;\u2022&lt;&lt;&lt;&lt;\r\n\r\n[SHOP HOURS]: Monday - Friday (We&#39;re artists so our hours vary!)\r\nWe are closed Weekends and U.S. Federal Holidays\r\n\r\n[ORDERS]: Orders may be placed 24\/7. Instant Download items will be sent once payment is confirmed unless combined with a personalized item. All other orders received on business days after 6:00 p.m. EST and on weekends and holidays will be processed the next business day in the order they were received. Please see individual listings for specific turnaround times.\r\n\r\n[RUSH ORDERS]: We are unable to accommodate rush orders at this time.\r\n\r\n[CUSTOM ORDERS]: Due to a fully-booked design and production schedule, we are unable to accommodate custom printable invitation and collection orders.\r\n\r\n[COMMUNICATION]: Emails and messages are answered in the order they are received when we have availability between processing and producing orders. All communications received on business days after 6:00 p.m. EST or on weekends and holidays will be answered the next available business day.\r\n\r\nWe are a two-person shop and appreciate your understanding as we strive for balance between parties, work and home!\r\n\r\n&gt;&gt;&gt;&gt;\u2022&lt;&lt;&lt;&lt;\r\n\r\nOur products and parties have been featured on and in:\r\nHostess with the Mostess \u2022 Pizzazzerie \u2022 Amy Atlas Events \u2022 Kara&#39;s Party Ideas \u2022 Tori Spelling&#39;s ediTORIal \u2022 Celebrations at Home \u2022 LilSugar \u2022 The Huffington Post \u2022 Tip Junkie \u2022 Catch My Party \u2022 Baby Lifestyles \u2022 Plush Little Baby \u2022 Nickelodeon Parents Connect \u2022 U Create \u2022 Party and Event Guide \u2022 The Party Wagon \u2022 Bird&#39;s Party Magazine \u2022 Tots to Teens Magazine  \u2022 and more!\r\n\r\nFollow us for party inspiration, tutorials, product updates and tons of fun!\r\n\r\nOink!, the BLOG: http:\/\/www.piggybankparties.com\/oink\/\r\nFACEBOOK: https:\/\/www.facebook.com\/piggybankparties\r\nTWITTER: http:\/\/twitter.com\/piggybankparty\r\nPINTEREST: http:\/\/pinterest.com\/piggybankparty\/\r\nINSTAGRAM: http:\/\/instagram.com\/piggybankparties\r\n\r\n&gt;&gt;&gt;&gt;\u2022&lt;&lt;&lt;&lt;\r\n\r\nWe hope your shopping experience will be as fun as it has been creating our products for you. Thanks for visiting The Market, Piggy Bank Parties&#39; Etsy shop! ",
      "currency_code": "USD",
