      "vacation_message": null,
      "sale_message": "We appreciate you ordering from us! Orders are processed and emailed\/mailed in the order they were received only on business days (Monday - Friday except U.S. Federal Holidays) after payment in full is received (eChecks will delay your order by 3-5 business days). Physical items are shipped only on business days (Monday-Friday except for U.S. Federal Holidays).\r\n\r\n\u25ba [REQUESTED WORDING & INFORMATION]: If you did not include the wording or information requested to complete your order (see listing) in the notes during checkout, please contact us immediately with that information. Your order will be ON HOLD and the turnaround time will not begin until we receive all of the requested information.\r\n\r\n\u25ba [DIY PRINTABLE ORDERS]: If you haven&#39;t received your DIY printable order within the timeframe stated in the listing, please check your spam\/junk folder for an email from Etsy (instant downloads) or from Hank, The Piggy Bank (all other downloads), prior to contacting our office. To avoid any delays, please add our email address to your address book-- hank{at}piggybankparties{dot}com.\r\n\r\nThank you!\r\nThe Piggy Bank Parties Crew",
      "digital_sale_message": "We appreciate you ordering from us!\r\n\r\n\u25ba Instant Downloads should be downloaded using a desktop computer. Other devices may cause file issues.\r\n\r\n[SOFTWARE REQUIRED]: The latest version of Adobe Reader (free download at www.adobe.com) is required to open these files. Printing directions are included with all PDF files except papers and posters.\r\n\r\n\u25ba It is IMPERITIVE that the PDF files are opened within Adobe Reader to work correctly. Many computers use their own non-Adobe PDF readers to automatically open files.\r\n\r\nIf you haven&#39;t received your DIY printable order within the timeframe stated in the listing, please check your spam\/junk folder for an email from Etsy (instant downloads) or from Hank, The Piggy Bank (all other downloads), prior to contacting our office. To avoid any delays, please add our email address to your address book-- hank{at}piggybankparties{dot}com.\r\n\r\nThank you!\r\nThe Piggy Bank Parties Crew",
