    "title": "MAPLE TACO  wooden spoon hand carved by Spoontaneous, wood spoon, wood carving, art spoons, spoon, carved spoon, mother&#39;s day",
    "description": "The MAPLE TACO  wooden spoon was hand carved by Spoontaneous from a weathered old piece of &#39;lace&#39; maple. \r\n\r\nOne of the jewelry artists from Etsy contacted me recently, letting me know she had a couple of large boxes of wood cut-offs which had been left behind by her woodturning ex-husband. She wondered if I would be interested in purchasing them since she lived within an hours drive.\r\n\r\nI was planning a trip down to Miami the next weekend anyway to visit one of the botanical gardens. It was easy enough to swing by and pick up the wood. This spoon is the first to come from that wood.\r\n\r\nThe exterior on this piece of wood had a nice texture and was already shaped somewhat like a spoon. I basically dug out the bowl and evened up the rest of it. The top of the handle I left with the natural texture, while the back of the spoon and inside the spoon bowl are finished.\r\n\r\nThe wood was fairly porous and I had to use several coats of finish to give the effect I wanted. I liked the contrast between the raw wood and the finished wood and wanted to emphasize that.\r\n\r\nThe spoon is 8 7\/8&quot; long and the bowl is 2 7\/8&quot; at the widest. The bowl actually is a sort of &#39;V&#39; shape and reminds me a bit of a taco. The handle has a hole or two, one of which penetrates all the way through.\r\n\r\nFinished with the decorative (not food safe) finish.\r\n\r\nShips Priority Mail.\r\n\r\nThanks for having a look.",
