    "title": "Funny Taco bout it T-Shirt funny Geek Geeks I dont wana Screen Printed T-Shirt Tee Shirt T Shirt Mens Ladies Womens",
    "description": "Funny Taco bout it T-Shirt \r\n\r\n\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\r\n\r\n\u2022\u2022\u2022 LIMITED TIME T-SHIRT SPECIAL \u2022\u2022\u2022\r\nBuy 3 T-Shirts and get the 4th FREE ...\r\nAdd 4 T-Shirts To Your Shopping Cart. \r\nApply the coupon code AWESOME at checkout!\r\n\r\n\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\r\n\r\nMy t-shirts and hoodies are screen printed by hand and made to order on 100% Cotton Tees and 50\/50 Hoodies. All shirts are screen printed in a smoke free environment. Only the best screen printing inks are used. I double hit each design to ensure that the design will last as long as the shirt.\r\n\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\r\n\r\nPRODUCT MEASUREMENT \/ SIZING\r\n\r\nBody length is measured from highest point on the shoulder to hem.\r\nChest is measured 1&quot; down from the arm pit across to the other arm pit.\r\nMeasurements are provided by manufacturer.\r\n\r\nMENS T-SHIRTS\r\n\r\nGildan Ultra Cotton Men&#39;s \/ Unisex T-shirt - Sizes Small to 3XL - 10.1-oz, 100% cotton \u2028\r\nNEW!!! Fruit Of The Loom Heavy Cotton HD\u00a0Mens \/ Unisex T-Shirt - Sizes 4XL to 6XL - 8.5-oz, 100% cotton at $18.99 !\r\n\r\nS = 28&quot; body length x 18&quot; chest \r\nM = 29&quot; body length x 20&quot; chest \r\nL = 30&quot; body length x 22&quot; chest \r\n\u2028XL = 31&quot; body length x 24&quot; chest \u2028\r\n2XL = 32&quot; body length x 26&quot; chest \u2028\r\n3XL = 33&quot; body length x 28&quot; chest \u2028\r\n4XL = 34&quot; body length x 30&quot; chest (sorry! Olive Green\/Sand not available in 4XL)\u2028\r\n5XL = 35&quot; body length x 32&quot; chest (sorry! Olive Green\/Sand not available in 5XL)\u2028\r\n6XL = 36&quot; body length x 34&quot; chest (sorry! Olive Green\/Sand not available in 6XL)\r\n\r\nLADIES T-SHIRTS \r\n\r\nFruit Of The Loom Heavy Cotton HD Ladies T-Shirt - Sizes Small to 3XL -\u00a0\u00a08.5-oz, 100% soft cotton\u2028. This new, awesome ladies tee\u00a0has slightly contoured side seams. This is not a &quot;juniors&quot; tee- it is a lovely women&#39;s cut. \u2028\u2028\r\n\r\nS = 25&quot; body length x 18&quot; chest \u2028\r\nM = 26&quot; body length x 19&quot; chest \u2028\r\nL = 27&quot; body length x 20.50&quot; chest \r\nXL = 28&quot; body length x 22&quot; chest \u2028\r\n2XL = 29&quot; body length x 23.50&quot; chest \u2028\r\n3XL = 30&quot; body length x 25&quot; chest\r\n\r\nYOUTH T-SHIRTS\r\n\r\nGildan Ultra Cotton Youth T-shirt - Sizes Small to XL - 10.1-oz, 100% cotton\r\n\r\nS = 22&quot; body length x 17&quot; chest Approximate kids size 6-8\u2028\r\nM = 23.5&quot; body length x 18&quot; chest Approximate kids size 10-12\u2028\r\nL=25&quot; body length x 19&quot; chest Approximate kids size 14-16\u2028\r\nXL= 26.5&quot; body length x 20&quot; chest Approximate kids size 18-20\r\n\r\n\u2022\u2022\u2022 Tees are preshrunk but allow for a slight shrinkage if you tumble dry, Line dry\/lay flat to maintain length. Grey Tees contain 10% polyester. Youth Hot Pink is Fruit Of The Loom. Mens\/Youth and Ladies tees are not an exact\u00a0colour match as they are different brands. Please Note - Shades of colors displayed may vary due monitors individual color display settings. Ink colour on the tees can not be changed. \u2022\u2022\u2022\r\n\r\n\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\r\n\r\nTERMS OF SALE\r\nJust a few things to note when buying from me. I like to make sure everything is laid out before you make your purchase.\r\n\u2022 Please select your style and size, and colour from the drop down menu or if on a mobile device please write a message in the &quot;notes to seller&quot; section. \r\n\u2022 Please look over the shipping costs before you buy an item. I am in Canada so shipping may be a little more then buying stateside. But trust me - it&#39;s worth it! Shipment costs to receive the awesome t-shirts are at the buyer&#39;s expense.\r\n\u2022 If you have any questions please ask! I normally respond in an hour or two as I am home with kids.\r\n\r\n\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\r\n\r\nSHIPPING & RETURNS\r\n\r\nMost orders will ship within 1 business day. If \u00a0for some reason we can&#39;t get the item out within\u00a024 hours, we will contact you directly.\r\n\r\nUSA --- Shipping from Canada to the USA on average is 5 -14 days.\r\n\u2028CANADA --- Shipping From Canada from GTA is standard postal times.\u2028\r\nWORLD WIDE --- Shipping from Canada to international destinations on average will take 7 - 21 days.\r\n\r\nShipping time depends on how long the\u00a0postal system in your country holds an item at customs for inspection. Please note that due to a lack of security within certain postal systems we will not ship to Brazil, Italy, Russia, UAE. We reserve the right to refund and cancel transactions if the shipping country is not advisable.\r\n\r\nOn all exchanges (new colour\/new size) you pay the shipping to return it to me, and when I receive it, I will pay the shipping to send you the replacement. All refunds are minus shipping costs. If I have made an error (doesn&#39;t happen often, but I&#39;m human!) then I will pay shipping to return the incorrect item and to replace it with a new one. Custom designed and personalized name\/year tees are final sale with no exchange or refund.\u00a0THERE IS NO PROBLEM THAT CAN&#39;T BE SOLVED!\r\n\r\n\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\u2584\r\n\r\nAll the best to you and yours and thank you for shopping with me! Stacey :)",
