      "policy_payment": "Payment methods are direct checkout with Credit Card, Gift Certificate or PayPal.",
      "policy_shipping": "\u2022\u2022\u2022 Please be sure to review your mailing information within Etsy to be sure address is up to date and has all necessary info (apt, unit, suite, po box etc) \u2022\u2022\u2022\r\n\r\n\u2022\u2022\u2022 If you purchase a personalized family name and year shirt, please be sure to put a note in the checkout or send a message\/convo for what name and year you&#39;d like to avoid delay :) \u2022\u2022\u2022\r\n\r\nAll shirts are made to order and ship within 24 to 48 hours. I do my best to stock all shirt colours, sizes and styles. If by chance a requested size or colour is out of stock you will be contacted immediately with a time estimate or other options.\r\nItems returned as undeliverable may be reshipped at buyers expense or refunded minus shipping. Shipping costs to receive these awesome tees are at buyers expense.\r\nCanada: 2-7 day delivery via standard mail\r\nUSA: 5-14 day delivery via USPS Air Mail (time dependant on customs processing)\r\nInternational: 7-21 day delivery via Air Mail (time dependant on customs processing)\r\n\r\nShipping time depends on how long the postal system in your country holds an item at customs for inspection. Please note that due to a lack of security within certain postal systems we will not ship to Brazil, Italy, Russia, UAE. We reserve the right to refund and cancel transactions if the shipping country is not advisable.",
      "policy_refunds": "\u2022\u2022\u2022 On all exchanges (new colour\/new size for stock designs) you pay the shipping to return it to me, and when I receive it, I will pay the shipping to send you the replacement. All refunds are minus shipping costs. \r\n\r\n\u2022\u2022\u2022 If I have made an error (doesn&#39;t happen often, but I&#39;m human!) then I will pay shipping to return the incorrect item and to replace it with a new one. \r\n\r\n\u2022\u2022\u2022 Bulk orders of the same design in quantities of four pieces of the same design or more are final sale.  Custom designed and personalized name\/year tees are final sale with no exchange or refund. \r\n\r\n\u2022\u2022\u2022 THERE IS NO PROBLEM THAT CAN&#39;T BE SOLVED! \u2022\u2022\u2022",
      "policy_additional": "*************************************************\r\n\r\n\u2022\u2022\u2022 LIMITED TIME T-SHIRT SPECIAL \u2022\u2022\u2022\r\n\r\nBuy 3 T-Shirts and get the 4th FREE!\r\nAdd 4 Items To Your Shopping Cart.\r\nApply the coupon code AWESOME at checkout! (coupon value $14.99 USD when buying 4 items))\r\n\r\nBuy 6 T-Shirt and Get the 7th and 8th FREE!\r\nAdd 8 Items To Your Shopping Cart.\r\nApply the coupon code KAPOW at checkout! (coupon value $29.98 USD when buying 8 items)\r\n\r\nBuy 9 T-Shirt and Get the 10th, 11th and 12th FREE!\r\nAdd 12 Items To Your Shopping Cart.\r\nApply the coupon code MONDO at checkout! (coupon value $44.97 USD when buying 12 items)\r\n\r\n*************************************************\r\n\r\nAll items are shipped from my shop, printed by hand, new with tags and handled with care! \r\n\r\nBuying a gift? I&#39;m happy to include a hand written note in the package - please include note details at time of purchase. I&#39;m terribly sorry I&#39;m not able to offer gift wrap - items are shipped in secure plastic poly mailers to keep the shirt clean and dry, but gift wrap would arrive crumpled. \r\n\r\nPlease note that the ink colour does not change.\r\n\r\n\r\n*************************************************\r\nPRODUCT MEASUREMENT \/ SIZING\r\n\r\nPlease &quot;Read More&quot; in the listing to view size charts for each product.\r\n\r\n**************************************************\r\n\r\nAll the best to you and yours and thank you for shopping with me! Stacey :) \r\n\r\n",
