    "description": "Fabulous Tacos and Tequila Rehearsal Dinner invitations with colorful typography and illustrations all on a chalkboard background. Great for a Mexican Fiesta themed rehearsal dinner for the new couple. Features a big glass of Margaritas and a taco with banner. This can be changed to a birthday, shower or any Mexican themed occasion. Hand drawn illustration by McBooboo.\r\n_______________________\r\nABOUT THIS LISTING:\r\n\r\nThis is for a PRINT IT YOURSELF 5&quot; x 7&quot; invitation in a digital file.\r\nNO PRODUCT WILL BE SHIPPED\r\nText or background colors can be changed.\r\n\r\nNeed them PRINTED see below \u201cPrinting options\u201d\r\n\r\nNeed a RUSH ORDER click on \u201cGet them Printed \/ Rush Orders\u201d in my shop sections\r\nhttps:\/\/www.etsy.com\/shop\/McBooboos?section_id=14500439\r\nOR add it on here with the drop-down menu under OPTIONS.\r\nRUSH ORDERS: YOU WILL RECEIVE A DIGITAL FILE IN 24 HOURS OR LESS!\r\n\r\n_______________________\r\n\r\nHOW TO ORDER: \r\n- Click &quot;Add to Cart&quot; then complete transaction\r\n- Include your party information in &quot;note to seller,&quot; with an email to tkatz [!at] me.com. Be sure to include the card info: Party info: Date, Time, Name, Location, RSVP date & email\/phone, and anything else you want to include. \r\n\r\nWHAT YOU GET:\r\nA high resolution jpeg file. Then you can print at home, post on Facebook or go green and email to friends and family, or order prints online for delivery or pick up at your local photo lab. \r\n\r\nMORE PRINTING DETAILS:\r\n1) Print on your home printer or any printer\/copier you might have access to\r\n2) Put file on a portable thumb drive & take to Kinko&#39;s, Staples, Office Depot, Copy Max, etc & they will print for you.\r\n3) Post image on Facebook or any other website\r\n4) Email to your guests\r\n5) Order prints from a local or online photo lab. Upload your high resolution .jpeg file to any photo lab website (i.e. Walmart.com, Walgreens.com, Snapfish.com, Shutterfly.com, etc. You can choose to pick your invitations up from your local lab in as soon as one-hour or many of the online photo services will mail you your invites. Choose matte\/lustre finish.\r\n-----------------------------------------\r\nPRINTING OPTIONS:\r\nMcBooboo\u2019s can have these invitations printed for you and they come with white envelopes.\r\n\r\nPlease visit the \u201cGET THEM PRINTED & RUSH ORDERS\u201d section of my shop\r\nhttps:\/\/www.etsy.com\/shop\/McBooboos?section_id=14500439\r\n\r\n1- Select the quantity you need \r\n\r\n2- Add to Cart\r\n\r\n3- Please include the name of the invite (just the first few words) and all of your party info, line by line. Take your time with this and check all of your spelling and check to see if you put in date, time, address, rsvp, etc. in the message to seller section.\r\n___________________\r\n\r\nUpon payment, I will send you a proof via email for you to approve. \r\n\r\nOnce approved:\r\n\r\nShipping will be delivered within 3-5 business days after the manufacturing of your product if ordered before 3pm EST.Invitations will be delivered via UPS and shipper does not accept PO boxes, APOs or FPOs.\r\nPlease note that Saturday and Sunday are not business days.\r\n-----------------------------------\r\nNo international orders\/ All sales final\/ No returns\r\n\r\nIf you have questions just message me tkatz@me.com\r\n\r\nThanks for visiting McBooboo\u2019s!\r\nFeel free to email me at tkatz [!at] me.com with questions before you purchase if you have any questions.\r\n---------------------------------------\r\nTURN AROUND TIME:\r\nI can usually get a proof to you within 1-2 days or less. If you need it ASAP please email at tkatz [!at] me.com or click on \u201cGet them printed\/ rush orders\u201d in my shop sections\r\n\r\nPLEASE NOTE*** This file is for personal use only. You may not forward, share,sell, or \r\ndistribute this file. It is for non-commercial use only.\r\n\r\nColors may vary between online viewing and actual printed item. Just keep in mind that all monitors display colors differently.\r\n\r\nThanks for visiting McBooboo\u2019s!",
