    "description": "***This item is a clearance\/last chance item.  Once they are sold out I will not be making anymore.  When it expires, it&#39;s gone.  Get it now while you still can!***\r\n\r\nYay, tacos!  This taco hopes you are as excited to be be wear it, as it is to be worn by you.\r\n\r\n\u2665Measures:  2 cm high x 4 cm wide x .5 thick\r\n\u2665Comes with 20&quot; ball chain\r\n\r\n\u2665I use acrylic paint and Sculpey glazes on my products.  \r\n\u2665Keep in mind that colors can vary depending on clay batch and monitor calibration.  All items are hand made, so there will be slight size, color and painting variations to the one pictured.\r\n\u2665All jewelry comes from a smoke free home.\r\n\r\nTo keep up to date on new items and promotions follow me on facebook at:  www.facebook.com\/cutepocalypse\r\n\r\nLike the design but don&#39;t like the color?  I&#39;d love to do a custom order for you; so convo me or hit that  request custom order link up above!\r\n\r\nPlease check out the other items available in my shop: http:\/\/www.etsy.com\/shop\/cutepocalypse\r\n\r\nPlease be sure to read all of my shop&#39;s policies thoroughly and if you have any questions, feel free to send me a convo.  http:\/\/www.etsy.com\/shop\/cutepocalypse\/policy\r\n\r\nCare\r\n***************************\r\n\u2665Polymer Clay is a durable but not indestructible medium. \r\n\u2665Polymer clay is a medium that, if taken care of, can last for many years.  It is advise able to keep drops on the floor and contact with water to a minimum.      \r\n\u2665Polymer clay items are not toys.  They should not be given to people under the age of 12.   There are often small pieces that could fall off and present a choking hazard to children.  \r\n\u2665Polymer clay can be wiped with a damp cloth to remove dust.",
