      "title": "Creatures!:  Some cuddly, all cute.",
      "announcement": "Welcome to the Cutepocalypse!  Everything in the shop is handmade by me, Shonna.  \r\n\r\nI&#39;m currently in the process of giving my shop and social media venues a face lift.  Check back regularly as I will be adding new items daily for a while.  Clearance items are at a low price, so snag them now, because when they expire I will no longer be offering them.\r\n\r\nI do love custom items.  Email me or send me a convo if you are interested in having something made just for you.\r\n\r\nLike the shop on facebook to keep up with what is new and for any sales we might be having!",
      "currency_code": "USD",
      "is_vacation": false,
