      "accepts_custom_requests": true,
      "policy_welcome": "Hi!  Welcome to cutepocalypse.  Here you will find cute in many forms!  I have cute, kawaii jewelry, as well as adorable figurines and art dolls (coming this fall). \r\n\r\nPlease be sure to read all of the policies thoroughly and if you have any questions feel free to send me a convo.",
      "policy_payment": "I accept Paypal and Direct Checkout.\r\n\r\nFor already made items, I will have them shipped within 48 hours of receiving payment, unless it&#39;s Friday afternoon (then it will go out first thing Monday morning.   \r\n\r\nIf I have not received payment for the order within 24 hours, I will cancel the purchase and relist it.  \r\n\r\nFor custom orders, please convo me for rates and timelines.  Payment for custom orders must be received before I can begin work.  Rates and timelines will depend upon the number\/size of the order.  As I progress, I will send you photos for final approval before baking, painting, finishing and shipping it out.",
      "policy_shipping": "Jewelry items come in a well wrapped and heavily bubbled package.  They come in an organza pouch and are then wrapped in bubble wrap, and placed in a bubble mailer. Sculptures will be well packaged and packed accordingly to their size and shape.\r\n\r\nItems will be shipped within 48 hours of purchase (usually 24).  I ship on a Monday-Friday morning schedule.  If you order on Friday afternoon or Saturday , I won&#39;t be able to ship until Monday.\r\n\r\nI always put delivery confirmation on packages.\r\n\r\nI use your Etsy address for mailing.  If you need it delivered to a different address or are sending it as a gift please let me know in the message to seller portion of the order so it gets mailed to the right address.\r\n\r\nI usually ship with whichever is cheaper out of parcel post or first class.  This way that I can keep costs lower.  The package will make its way to you in approximately 2-7 days.  If you need a method of shipping that is expedited, please contact me because there is an additional charge for it.\r\n\r\nInternational Orders:  I do offer international orders, but on a case by case basis.  If you are outside of the US please contact me and we can work out a method to get the item to you.   Also, you would responsible for all custom and duties charges.\r\n\r\nHoliday Season Notes:  During the holiday season, there is a influx mail for the postal service.  To ensure that your package will arrive in time for Christmas, the sooner you get you order in, the better the chance of it arriving on time.  ",
      "policy_refunds": "If your item arrives broken, I will replace it.  I will need a photo of proof.  This not only is security for me but also helps me to see if\/how improvements need to be made to my products.\r\n\r\nIf you receive the item and you do not like it or are disappointed with it, you have 24 hours to contact me for a refund.  The 24 hour time frame is based off of the delivery confirmation time. If you decide that you want the refund, you must ship it back to me.  The responsibility of shipping charges will be on the buyer.  The refund will be given only if the item is in the original condition it left in.\r\n\r\nI always put delivery confirmation on all orders.  If the item is confirmed as delivered then I do not offer refunds or replacements for a &quot;lost&quot; item.  If the item is lost and never was confirmed, I will replace it at no cost to you.  If you have a custom order or something a little more expensive and want insurance on it, convo me and we will work out the charge.\r\n\r\nPolymer clay is a medium that, if taken care of, can last for many, many years.  It is advisable to keep drops on the floor and contact with water to a minimum.  See descriptions and Additional Information for more information on how to care for your items.  Most minor breaks are fixable with super glue.  I do not offer refunds for items once they are in your possession, that didn&#39;t arrive broken.  Please take care of your items and they should last you a while.",
      "policy_additional": "Polymer Clay is a durable but not indestructible medium.  I glaze pieces to enhance their looks, colors and durability.  The glaze only enhances the strength, it doesn&#39;t make it invincible.  \r\n\r\nPolymer clay should not be worn while swimming or showering.  Minimize the amount of time it is in water.  Do not wear polymer clay to bed as it could be damaged.    \r\n\r\nPolymer clay items are not toys.  They should not be given to children as they are not indestructible and pieces broken off present a choking hazard.\r\n\r\nPolymer clay can be wiped with a damp cloth to remove dust.\r\n\r\nKeep in mind that colors can vary depending on clay batch and monitor calibration.  All items are hand made, so there will be slight size, color and painting variations.\r\n\r\nPolicies can and will change over time as situations arise. So check back, if you are a return customer.",
