    "description": "Art Title:  My Spanish Harlem Mona Lisa\r\n\r\nFile Type:  JPG\r\n\r\nArt print size:  8&quot; x 10&quot;\r\n\r\nCheck out my store for more printables and awesome coloring book pages.\r\n\r\nThis listing is for a download of the art pictured above.  Please note your download will not have the &quot;Black River Art&quot; watermark or modesty marks on it when you receive the file. \r\n\r\nThis art will print perfectly on a regular sheet of plain copy paper (8 1\/2&quot; x 11&quot;) after downloaded.  After you make your purchase, Etsy will send you an email with a link to download the image to your computer.  You can then print it out as many times as needed to color, so don&#39;t worry about messing up.  \r\n\r\nThis print would look cool hanging on your wall or you could have fun coloring this beautiful woman illustrated in the style of art nouveau.  I titled this piece &quot;My Spanish Harlem Mona Lisa.&quot; You could use colored pencils, crayons, markers, or whatever you choose.  If you have the time when you are done, I would love to see your finished color work.  You can pop me a pic through email.  I love as an artist to see what other artists do with their imagination.  :0)\r\n\r\nPlease note that I hold the copyright to this original art piece that was designed by me.  Please print it out, color it, hang it on your wall, or gift it to someone you love, but don&#39;t resell the art when you are done.  Peace and have fun coloring!  :0)\r\n\r\nCopyright 2013 Karlon Douglas\/Black River Art",
