      "policy_welcome": "Hi There!  I&#39;m trying to think of something fun and witty to put here but my brain hurts ^_^\r\n\r\nPlease note that all Plushies, Characters, and Patterns in the Yummy Pancake shop are designed by Denise Ferguson and are protected by law.\r\n\u2122 + \u00a9 2008, 2013 Denise Ferguson",
      "policy_payment": "PAYMENT\r\n\r\nOrders are not shipped until payment is received.  I accept Paypal and CC\r\n\r\nPaypal payments must be received within 5 days of placing your order or your order will be cancelled.\r\n\r\nIf you send payment by echeck through Paypal, your order will not be sent until it is cleared(usually 3-5 days).",
      "policy_shipping": "~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\nSHIPPING\r\n\r\nAll orders are shipped USPS First Class Mail which DOES NOT include a tracking number. I typically get to the post office 2 days a week, usually Tuesday & Friday. If you are interested in upgrading to Priority mail or adding delivery confirmation for an extra charge, please let me know, and I will send you an updated invoice.  \r\n\r\nOrders are shipped in tyvek envelopes or recycled boxes\r\n\r\nPlease note that I will ship to the address on your etsy receipt unless you notify me otherwise.\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\nINTERNATIONAL ORDERS\r\n\r\nI am more than happy to ship outside the US, and I will do so upon request. Please let me know if you are interested and I will provide you with a shipping quote.  To keep shipping costs low, I ship USPS First Class International for outside the US.  Please note that these methods DO NOT have a tracking number.",
      "policy_refunds": "I sell both completed plush as well as PDF patterns to make my designs in my shop.  Listings that are for PDF crochet patterns specifically say so in the title and description.  Please note that refunds WILL NOT be given if you don&#39;t read my titles and listings completely and carefully and purchase a pattern expecting to receive a physical plush.\r\n\r\nIf you are not satisfied with your purchase, contact me within 5 days of receipt to arrange for a return and refund. Shipping costs will not be refunded and the buyer will pay all return shipping costs. All items must be returned in the same condition in which they were sent.\r\n\r\nNo returns on custom or special orders or international sales.",
      "policy_additional": "~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\nMTO\r\n\r\nPlease take note that most of my items are made to order. Please allow 3-5 days for me to put your order together and ship it out to you. Custom orders take a little longer.\r\n\r\nMy items are all lovingly handcrafted and come from a smoke free and cat-friendly home. No, I don&#39;t let Threecat, Jericho and Guinness sleep in my yarn and rub all over my plush, but they do live under the same roof as me.  ^_^\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\nCUSTOM ORDERS\r\n\r\nI LOVE them!  They rock!  Have an idea for something you&#39;d like me to make?  Just send me a convo, and we can discuss your idea, and I can provide a price estimate and approximate time for completion.  \r\n\r\nGuidelines for custom orders:\r\n\r\n1.  Please provide as much detail as possible up front as far as what you are looking for.  If you don&#39;t have a lot of detail, that&#39;s okay!  I&#39;ll take whatever info you provide and put my own artistic spin on it.\r\n2.  Do not ask me to reproduce a licensed character or another artist&#39;s work.  It&#39;s not cool, and I won&#39;t do it.\r\n3.  Any changes, additions, or rework made after I have completed your piece may incur additional charges.\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\nBULK ORDERS\r\n\r\nDo you need a larger quantity of something? Just let me know! I can evaluate my current workload and let you know what I would be able to accommodate...remember, I&#39;m a one woman show ^_^",
