      "announcement": "Welcome to Wild Crow Farm Pottery!  \r\n*** ALL PIECES IN OUR SHOP PHOTOS ARE READY TO SHIP ***\r\n\r\nHave fun exploring our latest creations straight from the mountains of Northern California.  \r\nWe lovingly work to create unique ceramic art using a variety of techniques such as wheel-thrown and hand building.  \r\n\r\nAll pieces are carefully crafted to bring beauty to your home.  They are fired at cone 6 or higher creating long-lasting stoneware of exceptional quality.  Glazes are food safe, oven and dishwasher safe unless otherwise noted.  This artwork is microwave safe, too, although we don&#39;t recommend it. (It&#39;s the hippie in us).\r\n\r\nOur goal at Wild Crow Farm is to provide beauty and a bit of joy to your life! \r\n&lt;&lt;&lt; We are happy to hear from you if you want custom pottery created.  Please contact us.&gt;&gt;&gt;\r\n Please visit Wild Crow Farm&#39;s Mercantile Store (Wild Crow Farms Mercantile) on etsy for very fun, bright and unique towels, gloves, beautiful quilts, and more at:\r\nwww.etsy.com\/shop\/juliegalbraith\r\n\r\nENJOY!\r\n\r\n*** All CA residents pay sales tax of currently 7.75%  ",
