    "description": "1980s Rainbow Bright Sprite ~ Blue with tags Taco Bell Promotional Item\r\n\r\nThis toy was given away as a promotional at Taco Bell in the 1980s. I was a huge Rainbow Bright fan and just loved the Sprites. This guy has his tag that shows his name and even how to speak his language. It&#39;s cute. It&#39;s about 6&quot; or so. No flaws to mention. \r\n\r\nTruly vintage and oh so cute!! \r\n\r\nI check these vintage items over very closely and will note any flaws. They are rarely new in their package, so please assume they were used lovingly and are in such condition. I wouldn&#39;t sell anything I wouldn&#39;t use or display in my own home. \r\n\r\nI am a lover and seller of all things vintage. I long for a time when a home was filled with a lovely, feminine touch and was a place for families to enjoy each other.  If you have any questions, please feel free to contact me. Thanks for shopping with My Deer Owl!!",
