      "login_name": "bdavis54",
      "accepts_custom_requests": true,
      "policy_welcome": "Welcome to the Felt Farm Market. The sun-dappled Farmers Markets that dot our cities are the inspiration for this Etsy Shop.The Felt Farm Market brings to your children, the same freshness, quality, and variety found at the real farmers&#39; markets in the form of handcrafted felt food for creative play.  As a gardener, I relish in the bounty and beauty of the garden, and I create foods for children&#39;s play with the same enthusiasm.  I hope you will come back to visit the market from time to time.  New offerings are always on the horizon.     ",
      "policy_payment": "The Felt Farm Market accepts PayPal.\r\n\r\nIf you do not have a PayPal account, you may use a credit card to pay for your purchase by following the easy steps outlined below.  You will notice the credit card logos listed next to the PayPal logo because credit card payments can be made through PayPal.\r\n\r\nClick on the &quot;Check  Out with PayPal&quot; button.  You will be taken to a secure page on PayPal.  \r\n\r\nJust below the log-in form, you will see &quot;Don&#39;t have a PayPal account?&quot;  You will be permitted to pay with your debit or credit card as a PalPay guest.\r\n\r\nEnter your debit or credit information.  Once you submit it, you will return to the Etsy Checkout to reiew and complete your order.  Make sure you click the green &quot;Submit Order&quot; button on Etsy.",
      "policy_shipping": "Your order will be shipped First Class USPS, generally within 2 to 3 days of receiving payment, in a padded envelope or box, depending on the size of the order.  \r\n\r\nIf you would like for your order shipped otherwise, please contact me.  I will be happy to work with you to make other arrangements.\r\n\r\nIf you are ordering from a foreign country, please contact me for shipping information and costs.\r\n\r\nOnly a small inventory exists, so most items will be crafted specifically for your child.   This may take several days, depending on the size of your order.  I will contact you if I anticipate delays in filling your order promptly.   \r\n\r\nPlease double check your shipping address to avoid delays or loss of shipment.  The Felt Farm Market will not responsible for issues arising from inaccurate shipping information. \r\n\r\n",
      "policy_refunds": "The Felt Farm Market strives to produce quality, pleasing,  well-constructed merchandise.  If, for any reason, you are not satisfied with your purchase, please  contact with me, so that we might work together to resolve any issues.    ",
